INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Avcılar İlçesi, Ambarlı Mezarlığı İstinat Duvarı Projesi', 2021, 1,1,1,2,1,3,'<p>​06.04.2021 tarihli ve 433101 TN&#39;li Başkanlık Oluru ile proje çalışmalarına başlanılmıştır. Kurum yazışmaları yapılmış olup, kurumlardan gelen bilgi ve belgeler Emay ile paylaşılmaktadır. Avan proje çalışmaları Müdürlüğümüze gelmiş olup, kontrolleri yapılmaktadır. 17.06.2021 tarihli 712007 TN ile Yapı İşleri Müdürlüğüne gönderilmiştir.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Avcılar İlçesi, Avcılar Tahtakale Yolu – Esenkent Bahçeşehir Bağlantı Yolu Caddesi Arası İmar Yolu Projesi', 2020, 1,1,1,2,1,3,'<p>​Başkanlık Oluru alındı. Kurum yazışmaları yapılıyor. Proje çalışmaları devam ediyor. Plankote&#160;kontrolleri Müdürlüğümüz tarafından tamamlandı.&#160; Milli Savunma Bakanlığı İstanbul İnşaat Emlak Bölge Başkanlığından NATO boru hattının geçmediği bildirilmiştir, BOTAŞ ile tekrar irtibata geçilip MSB&#39;den gelen kurum görüşü paylaşılmıştır. BOTAŞ, proje alanından hattının geçmediği bilgisini paylaşmıştır.&#160;Ayrıca, proje alanının bir kısmı Çevre ve Şehircilik Bakanlığı&#39;nın &quot;Bakanlık Proje Rezerv Alanında&quot; kaldığından ÇSB&#39;den kurum görüşü alındı, proje yapımına bir engel olmadığı, proje çalışmaları tamamlandıktan sonra ÇŞB İl Müdürlüğü ile de paylaşılmasının gerektiği belirtilmiştir. Proje alanı içerisinde kalan fakat farklı güzergahtan geçen köprü ve yol imalatlarının son aşamaya geldiğinden dolayı, avan&#160;proje Ulaşım Koordinasyon Müdürlüğüne tekrar değerlendirilmek üzere iade edilmiştir. 19.03.2021 tarihli ve 514 sayılı Başkanlık Oluru ile proje çalışmaları iptal edilmiştir.​<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Avcılar İlçesi, Gümüşpala Mahallesi D-100 Yanyol 1 (Londra Asfaltı) Caddesi İstinat Duvarı Uygulama Projesi', 2020, 1,1,1,2,1,3,'<p>​Başkanlık oluru alındı&#160;(TN:1048848). Kurum yazışması&#160;yapıldı(TN1093796). Kurum görüşleri iletiliyor. Sondaj yapıldı (08.02.2021). Proje işleri&#160; tamamlanıp 15.06.2021 tarih ve TN698503 sayılı yazı ile&#160;Altyapı Hizmetleri Müdürlüğüne gönderilmiştir.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
