INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Bayrampaşa Hali İlave Katlı Otopark Projesi', 2020, 1,1,1,2,1,3,'<p>İşin yapılması için Başkanlık Oluru Alındı.Kurumlardan işin yapılacağı yer belirtilerek görüş yazısı yazıldı. Hal Müdürlüğü ile imalatın yeri gezilip ihtiyaçlar için toplantı yapıldı. Proje Müellifi tarafından hazırlanılan Alternatif otopark yerleşimleri&#160;&#160;Hal Müdürlüğü ile paylaşıldı.Uygun alternatif seçildi. Yaklaşık&#160;(105+97+130*4)=&#160;722 araçlık otoparkı; B+Z+3 .NK+Teras kat=&#160;6&#160;katlı sayısı ve plan yerleşimi ile rampaların yerleri tespit edildi.Zemin etüdü çalışmaları sondajları yapıldı.Zemin etüdüne ait&#160;rapor hazırlandı. Avan Projeler hazırlandı.&#160;İmar Müdürlüğü&#39;nden&#160;İmar durumu alındı. 21/06/2021 tarih ve&#160;TN:633547 talep no yazı ile&#160; &#160;Yapı İşleri Müdürlüğü&#39;ne Avan Projeler incelenmesi için gönderildi&#160; .Yazı ile ayrıca&#160; projeninin&#160;&#160;&#160;uygulama projesine&#160;&#160;ilerlenmesi&#160; açısından görüşlerini belirtmesi&#160;istenildi.Yapı işleri Müdürlüğü&#160; söz konusu projeyi inceleyip , yatırım döneminde ödenek ayıramayacağı bildirdi.TN 847742 sayılı İşin durudurulması için&#160;Başkanlık Oluru&#160; alınarak iş durduruldu.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
