INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Beykoz İlçesi, Mucize Caddesi Mahmut Şevket Paşa Deresi Köprü Projesi (K-19)', 2020, 1,1,1,2,1,3,'<p>​​Başkanlık oluru alındı. Kurum yazışmaları yapılıyor. Firma ile arazi gezisi yapıldı. Sondaj çalışmaları tamamlandı.&#160;Proje çalışmaları devam ediyor. DSİ&#39;den gelen kurum görüşünde, proje alanında &quot;Riva Deresi Çevre ve Doğa Koruma, Su Güvenliği/Yönetimi Projesi ile Kentsel Tasarım Peyzaj Projesi Hazırlanması&quot; işi nedeniyle söz konusu proje alanıyla ilgili&#160;daha önceden gönderdikleri kurum görüşünde revizyonlar olacağından bahsedilmiştir. Bu konuda DSİ&#39;den&#160;ilgili&#160;kişilerle irtibat kurulmuş, revizyon çalışmaları tarafımıza iletilmiş olup, Emay ile paylaşılmıştır. Hazırlanan projeler Müdürlüğümüze gelmiş olup, gerekli incelemeler yapılmış ve projeyle ilgili&#160;düzeltilmesi istenilen kısımlar firma ile paylaşılmıştır. Son düzenlemeler ile proje teslime hazır hale gelmiştir. Proje çıktıları gelmiş olup Trafik paftaları onay için Trafik Müdürlüğüne gönderildi, onaylandı. 14.07.2021 tarihli ve 852927 TN ile Altyapı Hizmetleri Müdürlüğüne gönderilmiştir.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Beykoz İlçesi, Paşamandıra Caddesi Koz Deresi Köprü Projesi (K-08)', 2020, 1,1,1,2,1,3,'<p>​Başkanlık Oluru imzadan geldi. çalışmalara başlandı.​ Firma ile arazi gezisi yapıldı. Sondaj çalışmaları tamamlandı.&#160;Proje çalışmaları devam ediyor.DSİ&#39;den gelen kurum görüşünde, proje alanında &quot;Riva Deresi Çevre ve Doğa Koruma, Su Güvenliği/Yönetimi Projesi ile Kentsel Tasarım Peyzaj Projesi Hazırlanması&quot; işi nedeniyle söz konusu proje alanıyla ilgili&#160;daha önceden gönderdikleri kurum görüşünde revizyonlar olacağından bahsedilmiştir. Bu konuda DSİ&#39;den&#160;ilgili&#160;kişilerle irtibat kurulmuş, revizyon çalışmaları tarafımıza iletilmiş olup Emay firması ile paylaşılmıştır. Ön projeler kontrol için Müdürlüğümüze gelmiştir. Kontroller sonucu gerekli düzeltmeler firmaya bildirilmiştir. Gerekli düzeltmeler yapıldıktan sonra gelen projeler için çıktı bekleniyor. Çıktılar geldi, imzalar tamamlandı. Trafik paftaları Trafik Müdürlüğüne gönderilecek.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
