INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Eyüp, Işıklar – İstanbul Caddesi Köprü Projesi (G1-14)', 2017, 1,1,1,2,1,3,'<p>​Başkanlık Oluru alındı. Kurum yazışmaları tamamlandı. Daha önce başlanıp durdurulan proje imalatı devam ettirilmektedir. Firma ile arazi gezisi yapıldı. Proje çalışmaları devam ediyor. Plankote geldi, kontrolü yapıldı. Emay tarafından hazırlanan avan proje, mülkiyet problemi yarattığından ötürü, köprünün mülkiyete girmeyecek kadastral boşluğa taşınması talep edildi, proje çalışmaları devam ediyor. 07.01.2020 tarihinde sondaj çalışması tamamlandı. Yol güzergahı için avan proje geldi, yapılan incelemelerde bir yönde durak olmadığı ve yol genişliğinin dar olduğu (3mt)&#160;tespit edildi, durak yerleşimi ve yol kesiti için çalışmalar yapılarak firmaya gönderildi. Firma tarafından düzenlenen proje Müdürlüğümüzce incelenip gerekli olan düzenlemeler firmaya bildirilmiştir. Çıktı bekleniyor. Çıktılar geldi, imzalar tamamlandı. Trafik paftaları Trafik Müdürlüğüne gönderildi.<br/><br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Eyüp, İSKİ Tesisleri Fevzi Çakmak Caddesi Arası (İSKİ Tesis Yolu) Yol Rehabilitasyon Uygulama Projesi', 2017, 1,1,1,2,1,3,'Kot Farkının fazla olmasından, derin şevlerin bulunması ve yüksek gerilim hattı olmasından dolayı proje iptal edildi. 29.12.2017 tarih ve TN:1468072 sayılı yazı ile iptal edilmişitr.<br/>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Eyüp, Pirinçci Köy Yolu-2 Köprü Projesi (G1-5)', 2017, 1,1,1,2,1,3,'<p>Başkanlık Oluru alındı.Paket bütçesini aştığı tespit edildiğinden&#160;Proje çalışmaları gelinen aşamada durduruldu.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Eyüp, Selanik Bulvarı-2 Köprü Projesi (G1-13)', 2017, 1,1,1,2,1,3,'<p>Başkanlık Oluru alındı.Paket bütçesini aştığı tespit edildiğinden&#160;Proje çalışmaları gelinen aşamada durduruldu.<br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Eyüp,Eski Kemerburgaz Yolu Köprü Projesi (G1-3)', 2017, 1,1,1,2,1,3,'<div><table border="0" cellpadding="0" cellspacing="0" style="margin-top: 8px;"><tbody><tr><td valign="top" width="500px" class="ms-formbody"><table width="100%"><tbody><tr><td><div><p>​Başkanlık Oluru alındı. Kurum yazışmaları yapıldı. Daha önce başlanıp durdurulan proje imalatı devam ettirilmektedir.​ Sondaj verileri, eskiden yapılmış olan sondaj çalışmaları&#160;üzerinden ilerlemektedir. Firma ile arazi gezisi yapıldı. Proje çalışmaları devam ediyor. Plankote geldi, kontrolleri yapıldı. Ön projeler kontrol için Müdürlüğümüze gönderildi. Kontroller sonucu yol projelerinde eksikler firmaya bildirildi. Düzeltilmiş yol projeleri onaylandı. Yol ve sanat yapıları ile atık&#160;suyu ve içme suyu proje çıktıları imza için Müdürlüğümüze geldi. Atık su ve içme suyu projeleri onay için 09.02.2021 tarihli 226 sayılı yazı ile İSKİ&#39;ye gönderildi. İSKİ onaylı projeler imzalandıktan sonra sanat yapısı, yol, donatı, geoteknik projeleri ile birlikte uygulamacı birime gönderilecek. İSKİ tarafından yapılan incelemelerde istenen revizyonlar firma tarafından hazırlanıp imza için Kurumumuza teslim edildi, tekrar İSKİ&#39;ye gönderilen paftalar onaylandı. Projeler 09.04.2021 tarihli 459580 TN&#39;li yazı ile Altyapı Hizmetleri Müdürlüğüne gönderilmiştir.<br/></p></div></td></tr></tbody></table></td></tr></tbody></table></div><p><br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
