INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Güngören İlçesi, Tozkoparan Mahallesi Metro Sokak Yaya Üstgeçidinin Güçlendirilmesi veya Yenilenmesi Projesi', 2018, 1,1,1,2,1,3,'<p>Öneri yerleşim projesi onaylanmıştır. Tahsis Plan Paftası onaylanmıştır. Mevcut yaya üst geçidi doğu ayağı alan tahsisi hususunda Avrupa Yakası Milli Emlak Dairesi Başkanlığı kurum görüşü neticesinde hazırlanan tahsis talep formu, Emlak Müdürlüğüne, Avrupa Yakası Milli Emlak Dairesi Başkanlığına iletilmiştir. Bu doğrultuda, Emlak Müdürlüğünce Harita Müdürlüğüne 30.11.2020 tarihli BK No: 9016 sayılı yazı ile Avrupa Yakası Milli Emlak Dairesi Başkanlığının 20.07.2020 tarihli yazısı doğrultusunda ifraz dosyasının hazırlanarak iletilmesi talep edilmiştir. Öneri Ulaşım Projesi onaylanmış, UTK Kararı alınmıştır. Avan proje çalışılmaktadır. Emlak Müdürlüğü kurum görüşü beklenmektedir. Emlak Müdürlüğünce Müdürlüğümüze iletilen üst yazı doğrultusunda İmar Müdürlüğünden İmar Durumu Belgesi ve Kadastro Müdürlüğünden Koordinatlı Ölçü Krokisi talep edilmiş olup, temin edilen belgeler ifraz dosyası hazırlanmak üzere Harita Müdürlüğüne iletilmiştir. Bu doğrultuda, Harita Müdürlüğünce ifraz işlemi hususunda Emlak Müdürlüğüne gereği yönünde 06.07.2021 tarihli ve E-96786607-754 BK No: 2666 sayılı üst yazı iletilmiş olup, Emlak Müdürlüğünce değerlendirme aşamasındadır.</p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
