INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Kuruçeşme Parkı Sahili Onarım ve Güçlendirme Projesi', 2019, 1,1,1,2,1,3,'Plankote ve sondaj çalışmaları tamamlanmış olup, deformasyon oluşan alanda mevcut döşemenin bir kısmı kaldırılmış ve altındaki yapı incelenmiştir. Tespit e​dilen rıhtım yapısına göre çözüm yöntemi belirlenmiş olup, yönteme göre&#160;avan proje çalışmaları tamamlanmıştır. Proje&#160;Boğaziçi Öngörünüm alanında bulunduğundan dolayı İstanbul III Numaralı Kültür Varlıklarını Koruma Bölge Kurulu Müdürlüğüne iletilmek&#160;üzere Boğaziçi İmar Müdürlüğüne sunulmuştur.​ Boğaziçi İmar Müdürlüğünce onaylanan proje&#160;Kurul ile birlikte, sahadaki mevcut durum korunarak hazırlanan projenin bir kısmı kıyı kenar çizgisi dışında kaldığı için onay alınması hususunda&#160;Çevre ve Şehircilik Bakanlığına da&#160;gönderilmiştir.&#160;Koruma kurulunca; sunulan projenin uygun olmadığına,&#160;yeni yapı yapılmamak şartıyla statik açıdan gerekli tedbirlerin alımasında kültür varlığı açısından sakınca olmadığına,&#160;can ve mal güvenliğinin ivedilikle&#160;alınmasına, doğal değerler açısından Çevre ve&#160;Şehircilik&#160;Bakanlığı/İl Müdürlüğünce değerlendirilmesine karar verilmiştir.<br/>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
