INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Şişli Esentepe Mahallesi Belediye Hizmet Binası Projesi', 2017, 1,1,1,2,1,3,'Avan proje çalışmaları tamamlanmıştır. Arazide yapılan jeoradar çalışmasına göre proje alanından tarihi su hattı geçmektedir. Bu nedenle 21.06.2019 tarih ve TN: 647897 Sayılı Başkanlık Oluru ile&#160;proje çalışmaları&#160; &quot;avan proje&quot; aşamasında durdurulmuştur.', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Şişli Eskişehir Mahallesi Kreş ve Etüt Merkezi Projesi', 2018, 1,1,1,2,1,3,'30.10.2018 tarih ve 2603 sayılı yazı ile planlama müdürlüğünden plan tadilatı yapılması talep edilmiş, tadilat teklifi genel sekreter imzasında olduğu planlama müdürlüğü tarafından iletilmiştir.<br/>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Şişli Feriköy Kent Parkı ve Zeminaltı Otopark Projesi', 2020, 1,1,1,2,1,3,'<p><span style="font-family: &quot;times new roman&quot;, serif; font-size: 13.3333px;"></span><span style="font-size: 9pt; font-family: &quot;times new roman&quot;, serif;">Başkanlık oluru alınmış olup, Georadar çalışması yapılmıştır.​&#160;​​2 alternatif taslak proje çalışılmıştır. Taslak projeler doğrultusunda İmar Müdürlüğü&#160;ile ön görüşme yapılmıştır. Mülkiyet sahibi İSKİ Genel Müd. ile yeni bir tahsis protokolü yapılması için Emlak Müd.&#39;ne 791799&#160; (28.07.2020) TN&#39;li yazı yazılmıştır, cevap beklenmektedir. Araç kapasitesinin artırılması için İSPARK&#39;tan projenin 1. Bodrum katının mekanik otopark olarak çalıştırılması konusu ile alakalı 1160558 (27.10.2020) TN&#39;li yazı yazılmış.&#160; İSPARK &quot;Zeminaltı otopark projelerinde mekanik sistemin daha sağlıklı çalışması ve arızaya sebebiyet oluşturmaması için, en üst katlar veya orta katlar tercih edilmektedir.&quot; diyerek görüşünü belirtmiştir.&#160; ±0.00 kotu altında ağaç yaşamı için yeterli toprak kalınlığı bırakılması konusuyla alakalı Avrupa Yakası Park ve Bahçeler Müd.&#39;den 1202652 (4.11.2020) TN ile görüş beklenmektedir. Diğer kurumlardan görüş beklenmektedir.​ İski Genel Müdürlüğü Arsanın Otopark yapılmak üzere tahsis ile ilgili&#160;Koruma Kuruluna görüş sordu.Koruma Kurulu Raportörü ile görüşüldü. Tünel Protal yapısına ait fotograf istediği fotograflar iletildi.İlerki günlerde görüşülmek üzere&#160;kurul gündemine alındı.&#160;</span><br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
