INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Eski İSKİ Hizmet Binası Alanı Rehabilitasyon ve Yeniden Kazanım Projelerinin Hazırlanması', 2017, 1,1,1,2,1,3,'<p>Uygulama projeleri müşavir firmaya gönderilmiştir. Bu safhada işin&#160;Başkanlık tarafından durdurulmasına karar verilmiştir. (Alanın tarihsel öneminden ötürü).&#160;</p><p style="text-align: justify;">Söz konusu alanda plan tadilatı gerekmektedir. Plan tadilatlarına altlık olacak avan projeler Fatih Belediyesi aracılığıyla Yenileme Kurulu&#39;na iletilmiştir. Yenileme kurulu peyzaj tasarımı ve otopark giriş çıkışı ulaşım ağının yeniden çalışılması istemiş olup revize projelerin tekrardan kurula gönderilmesi talep etmiştir. </p><p style="text-align: justify;">Bununla birlikte alanda 856 ada 18 parsel, 855 ada 1, 11, 13 ve tescil dışı alanlar bulunmaktadır. Bunlardan 856 ada 18 parsel İSKİ mülkiyetinde olduğu için bu alanın kamulaştırılması için 16.01.2018 tarih 185 sayılı yazı ile Emlak Müdürlüğü&#39;ne yazılmıştır. &#160;855 ada 1 parsel İBB ve şahıs mülkiyetinde olup bu bölgenin de kamulaştırılması için 16.01.2018 tarih 184 sayılı yazı ile Kamulaştırma Müdürlüğüne gönderilmiş olup, mahkeme süreci devam etmektedir.işlemler başlarken sahıslara ulaşılamamış, sonrasında şahıslar söz konusu kamulaştırma ile ilgili bilgi sahibi olmuşlardır. Hukuk müşavirliği tarafından tescil davası ve bedel tespit davası (yaklaşık 3 milyon) açılmıştır. <strong>Süreçlerin hızlı çözülebilmesi için Emlak&#39;tan sorumlu Genel Sekreter Yardımcısı ile Hukuk Müşavirliği&#39;ne bilgi verilmesi gerekmektedir</strong>.) Proje alanında tescil dışı alanlar bulunmakta olup hazineden tahsis yapılması için 16.01.2018 tarih 185 sayılı yazı ile Emlak Müdürlüğü&#39;ne gönderilmiştir.</p><p style="text-align: justify;">Mevcut Plan: İmar planındaki mevcut durum park alanında kalmaktadır. Planlama Müdürlüğü&#39;nden 05.12.2017 tarihinde gelen plan notunda &#39;<em>Park ve dinlenme alanları tabii zemin altında yapılacak yeraltı otoparklarında plan notlarının ilgili maddeleri şartlarına uyulacaktır</em>.&#39; denilmektedir.</p><p style="text-align: justify;">Önerilen Plan: Önerilen plan notu ile Park (Yer Altı Otopark) Alanında gösterilen kütlede yine bu alana hizmet edecek Kafe, Kitapçı vb. birimlerin yer alması sağlanmıştır.​<br/></p><p><br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
