INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Sarıyer, Gümüşdere Caddesi Köprü Projesi (G1-2)', 2017, 1,1,1,2,1,3,'<div><table border="0" cellpadding="0" cellspacing="0" style="margin-top: 8px;"><tbody><tr><td valign="top" width="500px" class="ms-formbody"><table width="100%"><tbody><tr><td><div><p>Başkanlık Oluru alındı. Kurum yazışmaları yapıldı. Daha önce başlanıp durdurulan proje imalatı devam ettirilmektedir.​ Firma ile arazi gezisi yapıldı. Proje çalışmaları devam ediyor. Plankote geldi, kontrolleri yapıldı. Yol kavşak avan projeleri Müdürlüğümüz tarafından inceleniyor. Yol projeleri incelendi, eksikler firmaya bildirildi. Düzeltilmiş yol projeleri geldi, Müdürlüğümüzce onaylandı. İncelenen sanat yapıları projeleri eksikleri bildirilerek firmaya gönderildi. Proje çıktıları geldi, paftalar imzalandı, 31.12.2020 tarih ve 2360 birim kayıt numarası&#160;ile Altyapı Hizmetleri Müdürlüğüne gönderilmiştir. Trafik paftaları Trafik Müdürlüğüne gönderildi, onay alındıktan sonra yapımcı birime gönderilecek. Trafik Müdürlüğü onaylı projeler ile imzalı taranmış projeler 04.02.2021 tarih ve 148142 Talep numarası ile Altyapı Hizmetleri Müdürlüğüne gönderilmiştir.<br/></p></div></td></tr></tbody></table></td></tr></tbody></table><br/></div><p><br/></p>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
INSERT INTO Project (ProjectTitle, ProjectIBBCode, RequestingDepartmentID, ResponsibleDepartmentID, ProjectOwnerPersonID, ProjectServiceAreaID, ProjectImportanceID,ProjectStatusID, ProjectStatusDescription, ProjectStatusDescriptionDate,IsFeasibilityNeeded, HasRelatedProject, UserID, CreationDate ) VALUES ('Sarıyer, Maslak Ayazağa Caddesi Hadım Koruyolu Caddesi Kesişimi Yol Kavşak Uygulama Projesi', 2017, 1,1,1,2,1,3,'Projeler Altyapı Hizmetleri Müdürlüğüne gönderildi.<br/>', '2021-08-22', 0,0, (SELECT TOP 1 Id FROM AspNetUsers),GETDATE());
